PRAGMA foreign_keys=OFF;
--
-- Create base database tables in a single transaction
--
BEGIN TRANSACTION;
--
-- Each GRIB message is produced by a Meteo center. It is just an integer code,
-- mostly referring to just a nation. WMO assigned, always abused by regional
-- centers.
--
CREATE TABLE orig_center(id     integer primary key,
                         center text);
--
-- Insert data
--
--
-- In a center, different subcenters can be identified. Again, very often
-- used and quite always undocumented and abused.
--
CREATE TABLE orig_subcen(id        integer,
                         center_id integer,
                         subcenter text,
       foreign key(center_id) references orig_center(id) on delete cascade);
--
-- Insert data
--
--
-- Different processes generating data. If the two above coding are abused,
-- try to imagine what happens with this third. REALLY difficult to mantain
-- ANY information on this as IT DOES NOT EXIST a central authorithy to
-- register codes.
--
CREATE TABLE orig_process(id        integer,
                          center_id integer,
                          process   text,
       foreign key(center_id) references orig_center(id) on delete cascade);
--
-- Insert data
--
--
-- Version 2 of the GRIB format tries to put some order in the terrible
-- mess of parameter tables of the first version arranging variables per
-- discipline and category. In my opinion not a real soution, but here we
-- are with this.
--
CREATE TABLE g2_discipline(id integer primary key,
                           name text);
--
-- Insert data
--
--
-- Discipline says for exemple "Meteorology", and category is "humidity" or
-- "mass" or "temperature" and the like.
--
CREATE TABLE g2_category(discipline_id integer,
                         id integer,
                         name text,
       foreign key(discipline_id) references g2_discipline(id)
           on delete cascade);
--
-- Insert data
--
--
-- How GRIB version 1 identifies what data numbers are about. Each center (or
-- subcenter) mantains its parameter table with an integer value 0/255 to
-- look up in up to 256 different tables what that variable is. And the
-- rotten fish smells from the head: NCEP in primis has internally two projects
-- using same codes for different tables. If this is not mess, please tell me
-- how this nightmare can be named.
--
CREATE TABLE g1_parameter(id           integer primary key,
                          center_id    integer,
                          subcen_id    integer,
                          table_id     integer,
                          parameter_id integer,
                          name         text,
                          descr        text,
                          units        text,
       foreign key(center_id, subcen_id) references orig_subcen(id, center_id)
       on delete cascade);
--
-- Insert data
--
--
-- A little bit clearer, but just because not widely used, is the Version 2
-- stuff. As all known variants of GRIB1 tables are coded from the beginning,
-- doesn't mean we have reached nirvana. Let us wait some years, and come back
-- to see how messy we can grow.
--
CREATE TABLE g2_parameter(id            integer primary key,
                          discipline_id integer,
                          category_id   integer,
                          parameter_id  integer,
                          name          text,
                          descr         text,
                          units         text,
       foreign key(discipline_id,category_id) references
               g2_category(discipline_id,id) on delete cascade);
--
-- Insert data
--
--
-- Time definitions accepted in both GRIB1 and GRIB2
--
CREATE TABLE timedef(id       integer primary key,
                     grib1key integer,
                     grib2key integer,
                     descr    text);
--
-- Insert data
--
--
-- Vertical level definitions accepted in both GRIB1 and GRIB2
--
CREATE TABLE leveldef(id       integer primary key,
                      grib1key integer,
                      grib2key integer,
                      name     text,
                      descr    text,
                      units    text);
--
-- Insert data
--
--
-- Vertical level. Each GRIB message is a slice at a particolar level or a
-- layer between two levels.
--
CREATE TABLE levels(id          integer primary key,
                    leveldef_id integer,
                    level1      float,
                    level2      float,
       foreign key(leveldef_id) references leveldef(id) on delete cascade);
--
-- Insert data
--
--
-- The grid for the "G" of the GRIB. Just a few are handled, ranging from
-- standard mesoscale projections to Plate Carre.
-- The emap text is just a string with the parameters for geolocation.
--
CREATE TABLE grid(id      integer primary key,
                  emap    text);
--
-- Ok, this is my first astraction. The atmospheric variable, with lookup
-- on both GRIB1 and GRIB2 tables. As the final target of the app is just
-- to extract weather forecasts, I have coded only for ground conditions
-- variables. This atmovar refers to a meteorological parameter at given
-- vertical level.
--
CREATE TABLE atmovar(id       integer primary key,
                     name     text,
                     descr    text,
                     units    text);
--
-- Insert data
--
--
-- Look up table to GRIB1. I hide here inside level complexity, to end up
-- only with time and grid.
--
CREATE TABLE atmovar_g1param(atmovar_id integer,
                             g1_id      integer,
                             level_id   integer,
       foreign key(atmovar_id) references atmovar(id) on delete cascade,
       foreign key(level_id) references levels(id) on delete cascade,
       foreign key(g1_id) references g1_parameter(id) on delete cascade);
--
-- Insert data
--
--
-- Look up table to GRIB2. I hide here inside level complexity, to end up
-- only with time and grid.
--
CREATE TABLE atmovar_g2param(atmovar_id    integer,
                             g2_id         integer,
                             level_id   integer,
       foreign key(atmovar_id) references atmovar(id) on delete cascade,
       foreign key(level_id) references levels(id) on delete cascade,
       foreign key(g2_id) references g2_parameter(id) on delete cascade);
--
-- Insert data
--
--
-- A place where I am interested to obtain a forecast.
--
CREATE TABLE place(id        integer primary key,
                   name      text,
                   adm1      text,
                   adm2      text,
                   longitude float,
                   latitude  float,
                   altitude  float);
--
-- Basic set of Italian Comuni
--
--
-- The relation with the place and the GRIB grid. We have here indexes on the
-- grid to reach the place, components of the wind rotation matrix if needed
-- and the grid mean resolution around the place to identify "the best" grid
-- in this respect.
--
CREATE TABLE place_grid(id       integer primary key,
                        place_id integer,
                        grid_id  integer,
                        pixel    float,
                        line     float,
                        ipos     integer,
                        crot     float,
                        srot     float,
                        locres   float,
       foreign key(place_id) references place(id) on delete cascade,
       foreign key(grid_id) references grid(id) on delete cascade);
--
-- This tables are to be back compatible with old MM5 processing.
--
CREATE TABLE mm5_dom1(id        integer primary key,
                   name      text,
                   adm1      text,
                   adm2      text,
                   longitude float,
                   latitude  float,
                   altitude  float);
--
-- This are Italian Comuni ONLY inside MM5 domain1
--
--
-- Same as above for place_grid, but just for MM5 domain1
--
CREATE TABLE mm5_dom1_grid(id       integer primary key,
                        place_id integer,
                        grid_id  integer,
                        pixel    float,
                        line     float,
                        ipos     integer,
                        crot     float,
                        srot     float,
                        locres   float,
       foreign key(place_id) references mm5_dom1(id) on delete cascade,
       foreign key(grid_id) references grid(id) on delete cascade);
--
-- Repeat for domain 2 (nested inside1)
--
CREATE TABLE mm5_dom2(id        integer primary key,
                   name      text,
                   adm1      text,
                   adm2      text,
                   longitude float,
                   latitude  float,
                   altitude  float);
--
-- Italian Comuni inside MM5 domain 2 ONLY
--
--
-- Same as above for place_grid, but for MM5 domain2
--
CREATE TABLE mm5_dom2_grid(id       integer primary key,
                        place_id integer,
                        grid_id  integer,
                        pixel    float,
                        line     float,
                        ipos     integer,
                        crot     float,
                        srot     float,
                        locres   float,
       foreign key(place_id) references mm5_dom2(id) on delete cascade,
       foreign key(grid_id) references grid(id) on delete cascade);
--
-- End of the game for MM5 domain3
--
CREATE TABLE mm5_dom3(id        integer primary key,
                   name      text,
                   adm1      text,
                   adm2      text,
                   longitude float,
                   latitude  float,
                   altitude  float);
--
-- Italian Comuni ONLY inside MM5 domain3
--
--
-- Same as above for place_grid, but for MM5 domain3
--
CREATE TABLE mm5_dom3_grid(id       integer primary key,
                        place_id integer,
                        grid_id  integer,
                        pixel    float,
                        line     float,
                        ipos     integer,
                        crot     float,
                        srot     float,
                        locres   float,
       foreign key(place_id) references mm5_dom3(id) on delete cascade,
       foreign key(grid_id) references grid(id) on delete cascade);
--
-- Indexes to speed up calculations
--
CREATE INDEX timedef_g1_index on timedef(grib1key);
CREATE INDEX timedef_g2_index on timedef(grib2key);
CREATE INDEX place_name_index on place(name);
CREATE INDEX place_grid_place_index on place_grid(place_id);
CREATE INDEX place_grid_res_index on place_grid(locres);
CREATE INDEX atmovar_g1param_g1_index on atmovar_g1param(g1_id);
CREATE INDEX atmovar_g1param_lev_index on atmovar_g1param(level_id);
CREATE INDEX atmovar_g2param_g2_index on atmovar_g2param(g2_id);
CREATE INDEX atmovar_g2param_lev_index on atmovar_g2param(level_id);
CREATE UNIQUE INDEX grid_emap_index on grid(emap);
CREATE UNIQUE INDEX place_index on place(name, adm1, adm2);
CREATE UNIQUE INDEX place_grid_index on place_grid(place_id, grid_id);
CREATE UNIQUE INDEX orig_center_index on orig_center(id);
CREATE UNIQUE INDEX orig_subcen_index on orig_subcen(id, center_id);
CREATE UNIQUE INDEX orig_process_index on orig_process(id, center_id);
CREATE UNIQUE INDEX levels_g1_index on leveldef(grib1key);
CREATE UNIQUE INDEX levels_g2_index on leveldef(grib2key);
CREATE UNIQUE INDEX g1_parameter_index on
       g1_parameter(center_id, subcen_id, table_id, parameter_id);
CREATE UNIQUE INDEX g2_discipline_index on g2_discipline(id);
CREATE UNIQUE INDEX g2_category_index on g2_category(id,discipline_id);
CREATE UNIQUE INDEX g2_parameter_index on
       g2_parameter(discipline_id, category_id, parameter_id);
--
-- Triggers to enforce referential integrity
--
CREATE TRIGGER genfkey11_insert_referencing BEFORE INSERT ON "atmovar_g1param" WHEN 
    new."g1_id" IS NOT NULL AND NOT EXISTS (SELECT 1 FROM "g1_parameter" WHERE new."g1_id" == "id")
BEGIN
  SELECT RAISE(ABORT, 'constraint failed');
END;
CREATE TRIGGER genfkey11_update_referencing BEFORE
    UPDATE OF "g1_id" ON "atmovar_g1param" WHEN 
    new."g1_id" IS NOT NULL AND 
    NOT EXISTS (SELECT 1 FROM "g1_parameter" WHERE new."g1_id" == "id")
BEGIN
  SELECT RAISE(ABORT, 'constraint failed');
END;
CREATE TRIGGER genfkey11_delete_referenced BEFORE DELETE ON "g1_parameter" WHEN
    EXISTS (SELECT 1 FROM "atmovar_g1param" WHERE old."id" == "g1_id")
BEGIN
  DELETE FROM "atmovar_g1param" WHERE "g1_id" = old."id";
END;
CREATE TRIGGER genfkey11_update_referenced AFTER
    UPDATE OF "id" ON "g1_parameter" WHEN 
    EXISTS (SELECT 1 FROM "atmovar_g1param" WHERE old."id" == "g1_id")
BEGIN
  SELECT RAISE(ABORT, 'constraint failed');
END;
