INSERT INTO "timedef" VALUES(10,51,192,'Climatological Mean Value. Multiple year averages of quantities which are themselves means over some period of time (P2) less than a year. The reference time (R) indicates the date and time of the start of a period of time, given by R to R + P2, over which a mean is formed; N indicates the number of such period-means that are averaged together to form the climatological value, assuming that the N period-mean fields are separated by one year. The reference time indicates the start of the N-year climatology. N is given in octets 22-23 of the PDS. If P1 = 0 then the data averaged in the basic interval P2 are assumed to be continuous, i.e., all available data are simply averaged together. If P1 = 1 (the units of time - octet 18, code table 4 - are not relevant here) then the data averaged together in the basic interval P2 are valid only at the time (hour, minute) given in the reference time, for all the days included in the P2 period. The units of P2 are given by the contents of octet 18 and Table 4.');
INSERT INTO "timedef" VALUES(11,113,193,'Average of N forecasts (or initialized analyses); each product has forecast period of P1 (P1=0 for initialized analyses); products have reference times at intervals of P2, beginning at the given reference time.');
INSERT INTO "timedef" VALUES(12,114,'null','Accumulation of N forecasts (or initialized analyses); each product has forecast period of P1 (P1=0 for initialized analyses); products have reference times at intervals of P2, beginning at the given reference time.');
INSERT INTO "timedef" VALUES(13,115,'null','Average of N forecasts, all with the same reference time; the first has a forecast period of P1, the remaining forecasts follow at intervals of P2.');
INSERT INTO "timedef" VALUES(14,116,'null','Accumulation of N forecasts, all with the same reference time; the first has a forecast period of P1, the remaining follow at intervals of P2.');
INSERT INTO "timedef" VALUES(15,117,'null','Average of N forecasts, the first has a period of P1, the subsequent ones have forecast periods reduced from the previous one by an interval of P2; the reference time for the first is given in octets 13-17, the subsequent ones have reference times increased from the previous one by an interval of P2. Thus all the forecasts have the same valid time, given by the initial reference time + P1.');
INSERT INTO "timedef" VALUES(16,118,'null','Temporal variance, or covariance, of N initialized analyses; each product has forecast period P1=0; products have reference times at intervals of P2, beginning at the given reference time.');
INSERT INTO "timedef" VALUES(17,119,'null','Standard deviation of N forecasts, all with the same reference time with respect to time average of forecasts; the first forecast has a forecast period of P1, the remaining forecasts follow at intervals of P2.');
INSERT INTO "timedef" VALUES(18,123,194,'Average of N uninitialized analyses, starting at the reference time, at intervals of P2.');
INSERT INTO "timedef" VALUES(19,124,'null','Accumulation of N uninitialized analyses, starting at the reference time, at intervals of P2.');
INSERT INTO "timedef" VALUES(20,125,'null','Standard deviation of N forecasts, all with the same reference time with respect to time average of the time tendency of forecasts; the first forecast has a forecast period of P1, the remaining forecasts follow at intervals of P2.');
